WITH filtered_date AS (SELECT d_date_sk, d_date FROM date_dim WHERE d_month_seq BETWEEN 1213 AND 1224), filtered_customer AS (SELECT c_customer_sk, c_last_name, c_first_name FROM customer WHERE c_birth_year BETWEEN 1968 AND 1974), store_set AS (SELECT DISTINCT fc.c_last_name, fc.c_first_name, fd.d_date FROM filtered_date fd, filtered_customer fc, LATERAL (SELECT 1 FROM store_sales ss WHERE ss.ss_sold_date_sk = fd.d_date_sk AND ss.ss_customer_sk = fc.c_customer_sk AND ss.ss_list_price BETWEEN 168 AND 197 AND ss.ss_wholesale_cost BETWEEN 76 AND 86) AS _), catalog_set AS (SELECT DISTINCT fc.c_last_name, fc.c_first_name, fd.d_date FROM filtered_date fd, filtered_customer fc, LATERAL (SELECT 1 FROM catalog_sales cs WHERE cs.cs_sold_date_sk = fd.d_date_sk AND cs.cs_bill_customer_sk = fc.c_customer_sk AND cs.cs_list_price BETWEEN 168 AND 197 AND cs.cs_wholesale_cost BETWEEN 76 AND 86) AS _), web_set AS (SELECT DISTINCT fc.c_last_name, fc.c_first_name, fd.d_date FROM filtered_date fd, filtered_customer fc, LATERAL (SELECT 1 FROM web_sales ws WHERE ws.ws_sold_date_sk = fd.d_date_sk AND ws.ws_bill_customer_sk = fc.c_customer_sk AND ws.ws_list_price BETWEEN 168 AND 197 AND ws.ws_wholesale_cost BETWEEN 76 AND 86) AS _) SELECT COUNT(*) FROM ((SELECT * FROM store_set) EXCEPT (SELECT * FROM catalog_set) EXCEPT (SELECT * FROM web_set)) AS cool_cust